import React from 'react'

export default function CurrencySelect(props) {
  const { currencyName,currencyElements,currencySelected,currencyOnChange } = props

  return (
    <div>
      <select name={currencyName} value={currencySelected} onChange={currencyOnChange}>
        {currencyElements.map(element => (
          <option key={element} value={element}>{element}</option>
        ))}
      </select>
    </div>
  )
}
